import React from 'react';
import ReactDom from 'react-dom'

const TodoList =() => {
  return(
    <ul>
      <li>Learn React</li>
      <li>Build Awesome App</li>
    </ul>

  );
};

const el = (
  <div>
    <h1>My Todo List</h1>
    <input placeholder='search'/>

  </div>
);


ReactDom.render(el, document.getElementById('root'))
